import React from 'react';
import AtomSpinner from '@bit/bondz.react-epic-spinners.atom-spinner'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <AtomSpinner
          color='#000000'
          size='200'
        />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </header>
    </div>
  );
}

export default App;
